// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract FlintEvents {
    struct PublicEvent {
        uint256 id;
        string title;
        string location; // Address or coordinates
        uint256 maxAttendees;
        address owner;
        string description;
        string[] tags;
        uint256 creationTimestamp; // When the event was created
        uint256 startTimestamp; // When the event starts
        uint256 endTimestamp; // When the event ends
    }

    uint256 public nextEventId;
    mapping(uint256 => PublicEvent) public publicEvents;
    mapping(string => uint256[]) private eventsByTag; // tag -> list of eventIds
    mapping(address => uint256[]) public eventsByOwner; // optional for frontend filtering

    event EventCreated(
        uint256 indexed id,
        address indexed owner,
        string title,
        string location
    );

    function createEvent(
        string memory _title,
        string memory _location,
        uint256 _maxAttendees,
        string memory _description,
        string[] memory _tags,
        uint256 _startTimestamp,
        uint256 _endTimestamp
    ) public {
        require(bytes(_title).length > 0, "Title required");
        require(_maxAttendees > 0, "Max attendees must be > 0");
        require(_endTimestamp > _startTimestamp, "End timestamp must be after start timestamp");
        require(_endTimestamp > block.timestamp, "Event must be in the future");
        require(_tags.length <= 10, "Too many tags");
        require(_tags.length > 0, "At least one tag required");
        require(bytes(_location).length > 0, "Location required");

        PublicEvent storage newEvent = publicEvents[nextEventId];
        newEvent.id = nextEventId;
        newEvent.title = _title;
        newEvent.location = _location;
        newEvent.maxAttendees = _maxAttendees;
        newEvent.owner = msg.sender;
        newEvent.description = _description;
        newEvent.creationTimestamp = block.timestamp;
        newEvent.startTimestamp = _startTimestamp;
        newEvent.endTimestamp = _endTimestamp;

        for (uint256 i = 0; i < _tags.length; i++) {
            newEvent.tags.push(_tags[i]);
            eventsByTag[_tags[i]].push(nextEventId);
        }

        eventsByOwner[msg.sender].push(nextEventId);

        emit EventCreated(nextEventId, msg.sender, _title, _location);
        nextEventId++;
    }

    // ------------------------------
    // View Functions
    // ------------------------------

    function getPublicEvent(uint256 _id) external view returns (PublicEvent memory) {
        return publicEvents[_id];
    }

    function getEventsByTag(string memory _tag) external view returns (PublicEvent[] memory) {
        uint256[] memory ids = eventsByTag[_tag];
        PublicEvent[] memory taggedEvents = new PublicEvent[](ids.length);
        for (uint256 i = 0; i < ids.length; i++) {
            taggedEvents[i] = publicEvents[ids[i]];
        }
        return taggedEvents;
    }

    function getEventsByOwner(address _owner) external view returns (PublicEvent[] memory) {
        uint256[] memory ids = eventsByOwner[_owner];
        PublicEvent[] memory ownerEvents = new PublicEvent[](ids.length);
        for (uint256 i = 0; i < ids.length; i++) {
            ownerEvents[i] = publicEvents[ids[i]];
        }
        return ownerEvents;
    }

    function getAllEvents() external view returns (PublicEvent[] memory) {
        PublicEvent[] memory all = new PublicEvent[](nextEventId);
        for (uint256 i = 0; i < nextEventId; i++) {
            all[i] = publicEvents[i];
        }
        return all;
    }
}

